import { useEffect,useState } from "react";
const Dependency = () => {
    let[string,setString]=useState("Data")
    let[value,setValue]=useState(0)

    useEffect(()=>{console.log("use effect worked");},[value])
    return ( 
        <div className="dependency">
            <h1>Use Effect</h1>
            <h2>{string}</h2>
            <button onClick={()=>setString("new data/string")}>Change string</button>
            <h2>{value}</h2>
            <button onClick={()=>setValue(value++)}>Increase</button>
        </div>
     );
}
 
export default Dependency;
